import React from "react";
import { useLocation } from "react-router-dom";

export default function Preview() {
  const { state } = useLocation();
  const data = state?.formData || {};

  return (
    <div className="preview-container">
      <div className="resume-box">

        {/* ======= HEADER ======= */}
        <h1 className="name">{data.name || "Your Name"}</h1>
        <h3 className="role">{data.role || "Your Role"}</h3>

        {/* ======= EDUCATION ======= */}
        <h2 className="section-title">Education</h2>
        {data.education?.map((edu, index) => (
          <div key={index} className="edu-block">
            <div className="edu-row">
              <span className="bold">
                {edu.institute}, {edu.city}
              </span>
              <span>{edu.year}</span>
            </div>
            <p className="small-text">Course: {edu.course}</p>
            <p className="small-text">Grade: {edu.grade}</p>
          </div>
        ))}

        {/* ======= EXPERIENCE ======= */}
        <h2 className="section-title">Experience</h2>
        {data.experience?.map((exp, index) => (
          <div key={index} className="exp-block">
            <div className="exp-row">
              <span className="bold">{exp.role}</span>
              <span>({exp.years})</span>
            </div>
            <p className="italic">{exp.company}</p>
            <p>{exp.description}</p>
          </div>
        ))}

        {/* ======= PROJECTS ======= */}
        <h2 className="section-title">Projects</h2>
        {data.projects?.map((proj, index) => (
          <div key={index} className="proj-block">
            <div className="proj-row">
              <span className="bold">{proj.title}</span>
              <a href={proj.link} target="_blank" rel="noreferrer">
                {proj.link}
              </a>
            </div>
            <p>{proj.description}</p>

            <p className="bold">Key Points:</p>
            <ul>
              {proj.keypoints?.map((kp, kpIndex) => (
                <li key={kpIndex}>{kp}</li>
              ))}
            </ul>

            <p className="small-text">
              <span className="bold">Tech Used:</span> {proj.tech}
            </p>
          </div>
        ))}

        {/* ======= CERTIFICATES ======= */}
        <h2 className="section-title">Certificates</h2>
        <ul>
          {data.certificates?.map((cert, idx) => (
            <li key={idx}>{cert}</li>
          ))}
        </ul>

        {/* ======= PDF EXPORT ======= */}
        <button
          className="export-btn"
          onClick={() => window.print()}
        >
          Export PDF
        </button>
      </div>
    </div>
  );
}
